<html>
    <head>
        <link type="text/css" rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.1.2/css/bootstrap.min.css">
        <link type="text/css"rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">
        <style>
            body {
                font-family: tahoma;
                height: 100vh;
                background-image: url(https://i.picsum.photos/id/190/3000/2000.jpg?grayscale);
                background-size: cover;
                background-position: center;
                display: flex;
                align-items: center;
            }

            .our-team {
                padding: 30px 0 40px;
                margin-bottom: 30px;
                background-color: #f7f5ec;
                text-align: center;
                overflow: hidden;
                position: relative;
            }

            .our-team .picture {
                display: inline-block;
                height: 130px;
                width: 130px;
                margin-bottom: 50px;
                z-index: 1;
                position: relative;
            }

            .our-team .picture::before {
                content: "";
                width: 100%;
                height: 0;
                border-radius: 50%;
                background-color: #316f40;
                position: absolute;
                bottom: 135%;
                right: 0;
                left: 0;
                opacity: 0.9;
                transform: scale(3);
                transition: all 0.3s linear 0s;
            }

            .our-team:hover .picture::before {
                height: 100%;
            }

            .our-team .picture::after {
                content: "";
                width: 100%;
                height: 100%;
                border-radius: 50%;
                background-color: #316f40;
                position: absolute;
                top: 0;
                left: 0;
                z-index: -1;
            }

            .our-team .picture img {
                width: 100%;
                height: auto;
                border-radius: 50%;
                 box-shadow: 0 0 0 14px #f7f5ec;
                 transform: scale(0.7); transform: scale(0.7);
                /* transform: scale(1); */
                /* transition: all 0.9s ease 0s; */
            }

            /* .our-team:hover .picture img {
                box-shadow: 0 0 0 14px #f7f5ec;
                transform: scale(0.7);
            } */

            .our-team .title {
                display: block;
                font-size: 15px;
                color: #4e5052;
                text-transform: capitalize;
            }

            .our-team .social {
                width: 100%;
                padding: 0;
                margin: 0;
                background-color: #316f40;
                position: absolute;
                bottom: 0;
                left: 0;
                /* transition: all 0.5s ease 0s; */
            }

            /* .our-team:hover .social {
                bottom: 0;
            } */

            .our-team .social li {
                display: inline-block;
            }

            .our-team .social li a {
                display: block;
                padding: 10px;
                font-size: 17px;
                color: white;
                transition: all 0.3s ease 0s;
                text-decoration: none;
            }

            .our-team .social li a:hover {
                color: #316f40;
                background-color: #f7f5ec;
            }

        </style>
